description:
Loại bất động sản: Đất thổ cư 100%.
Phương thức thanh toán: Bán trực tiếp hoặc vay ngân hàng.
Vị trí tài sản: Ấp Bình Tiền 2, xã Đức Hoà Hạ, huyện Đức Hoà, tỉnh Long An.
Gần KCN Rạng Đông, cách cầu Xáng đường Tỉnh Lộ 10, Bình Chánh 2km.
Loại tài sản cụ thể như sau:
- Địa chỉ thửa đất: Xã Đức Hoà Hạ, huyện Đức Hoà, tỉnh Long An;
- Tờ bản đồ số: 26 - 1.
- Diện tích: 105m²;
- Giá: 1.815.000.000.
- Hình thức sử dụng: Sử dụng riêng 105m²;
- Mục đích sử dụng: Đất ở tại nông thôn;
- Thời hạn sử dụng: Lâu dài;
Tình trạng pháp lý: Sổ hồng riêng, sang tên tại văn phòng công chứng nhà nước.
Thông tin liên hệ: *** Nguyễn Tuấn.
